import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

function App() {

  const [data, setData] = useState([]);

  const getData = async () => {
    const   data   = await axios.get(`https://localhost:7079/Api/Authentication/Authentication/Test`);
    setData(data);
    console.log(data);

  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="App">

    </div>
  );
}

export default App;
